INSERT INTO `oa_task` VALUES ('3b64b382e10942529afdd343569dbdd5', '1', '关于美国仓库报废产品的处理', '1', '14', '关于美国仓库报废产品的处理，蔡老师已经把整理了的发照片给相关人员，总的意见是批量的产品如伸缩水管、婴儿背带、战术手套、购物袋等集中在一个小账号来销售处理，不报废，报废的产品主要是一些退货及库房损坏的产品，后者以蔡老师发来的图片为准。\r\n确定并登记后通知美国仓库报', '2', '', '2019-06-06 11:09:52', '2019-06-06 11:44:05');
