INSERT INTO `oa_task` VALUES ('5e7d060255954369836166f757c2bd13', null, '包间成餐厅控烟&ldquo;死角&rdquo;', '15', '15', '在所有公共场所中，餐厅无疑是二手烟暴露率最高的场所之一。\r\n\r\n伴随着多地地方性控烟条例的实施，这一问题得到了很大程度缓解。不过，即便在实施所谓&ldquo;最严控烟令&rdquo;的北京、上海等地，餐厅控烟也仍然存在&ldquo;死角&rdquo;，包间就是重灾区之一。\r\n\r\n&ldquo;包厢环境比较私密，我们通常看到客人抽烟会提醒，但是大部分时间客人不在视线范围内，我们也没办法全程看着。&rdquo;在北京市海淀区某山西菜馆内，一位服务员告诉记者，同时这位服务员表示，包间内客人吸烟的现象现在依然时有发生。\r\n\r\n一方面，服务员对于包间无法实时监督，另一方面，包间内的客人也并不会主动向餐厅投诉有人在室内吸烟。\r\n\r\n记者随机调查了多位在饭馆用餐的顾客，大部分顾客表示，如果是邻桌的陌生客人在抽烟，他们会选择找服务员投诉劝阻，但对于包间，通常不会过多关注。同在包间内共同用餐的朋友之间，更不会选择主动投诉，多选择&ldquo;睁一只眼闭一只眼&rdquo;。', '1', '', '2019-05-31 11:47:20', '2019-05-31 11:47:20');
