INSERT INTO `oa_task` VALUES ('8a3d27a38fe64edfb97d9cddf3a6babb', null, '100多年前，它见证了中国铁路从零起步', '15', '15', '1876年，铁路在中国大地上出现\r\n\r\n钢轨绵延、汽笛声声\r\n\r\n当我们穿越时空\r\n\r\n和这些铁路老物件来一次对话\r\n\r\n它能告诉我们的\r\n\r\n是中国铁路从追赶到领跑的历史脉络\r\n\r\n是铁路人勇当先行的恒久精神\r\n\r\n\r\n\r\n铁博寻宝：&ldquo;0号&rdquo;蒸汽机车\r\n\r\n\r\n\r\n它是中国铁道博物馆的镇馆之宝\r\n\r\n是中国保留至今最古老的蒸汽机车\r\n\r\n它见证着中国铁路从零起步\r\n\r\n从落后到繁荣的艰辛历程\r\n\r\n审核 不通过啊。88888888', '1', '', '2019-05-31 11:49:30', '2019-05-31 11:57:25');
